pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;
import "./Organisation.sol";
import "./Student.sol";
import "./Company.sol";
import "./OverAll.sol";
import "./Helper.sol";

contract Final {
    OverAll public overAll = new OverAll();
    Helper public helper = new Helper();

    function addOrganisation(string memory _organisationName) public {
        Organisation org = new Organisation();
        org.addOrganisation(_organisationName, msg.sender);
        overAll.addOrganisation(org);
    }

   
}
